import React, { useEffect, useState } from 'react';

function Profile() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [createdAt, setCreatedAt] = useState('');
  const [password, setPassword] = useState(''); // Novo estado para a senha

  useEffect(() => {
    const storedUsername = localStorage.getItem('username');
    const storedEmail = localStorage.getItem('email');
    const storedCreatedAt = localStorage.getItem('createdAt');
    const storedPassword = localStorage.getItem('password'); // Recuperar a senha armazenada

    if (storedUsername) {
      setUsername(storedUsername);
    }
    if (storedEmail) {
      setEmail(storedEmail);
    }
    if (storedCreatedAt) {
      setCreatedAt(storedCreatedAt);
    }
    if (storedPassword) {
      setPassword(storedPassword); // Definir o estado da senha
    }
  }, []);

  return (
    <div>
      <h1>Profile</h1>
      <p>Username: {username}</p>
      <p>Email: {email}</p>
      <p>Created At: {createdAt}</p>
      <p>Password: {password}</p> {/* Exibir a senha */}
    </div>
  );
}


export default Profile;
